values:
I do not really post here that often. Most of you I know in real life and some I have just met through here.

Tonight at around 7 pm central time I will be presenting my groups final presentation for my Master's program. I&nbsp;have to adopt a budhhist philosophy to the approaching time or I&nbsp;will freaking loose it.&nbsp;

Today's mantra is &quot;You are prepared, and you know what you are doing. Do not worry about anything it will get done.&quot; 

I say this to myself every time I&nbsp;want to run for the bathroom and throw up.&nbsp;

Technically I could possibly totally bomb my presentation tonight and still graduate. We are allowed one C in our courses and I have not burned that yet. But it is group work and I feel that if I do not do my best then the rest of my group will suffer. I can take the ding for my actions but I do not like other people taking the ding for me as well.

Debating on whether I am going to do one six page paper or two three page papers. It will depend on how difficult the six page paper is to write. Currently I am two pages in and still have a lot more to say.

I just received an email from alienware that I get a free upgrade to vista. I am not sure I want to do this. The techno geek in me is screaming and flailing.

I know I have better techno geeks on my flist. Has anyone really worked with this program? Do you recommend it?

In general I always try to wait at least 6 months when a new Microsoft program comes out before I buy it.&nbsp;

So today is Christmas.&nbsp;I am in Kansas and all my family is here.

Can someone please explain to me then why I woke up this morning crying with this sense that I would always be alone?&nbsp;

I can be such a silly girl at times.
